class Solution:
    def minStartingIndex(self, s: str, pattern: str) -> int:
        base = 499
        s_len = len(s)
        p_len = len(pattern)
        if p_len > s_len: return -1
        pow = [1 for _ in range(s_len)]
        hash = [1 for _ in range(s_len)]
        hash[0] = ord(s[0]) - ord('a')+1

        p_hash = [1 for _ in range(p_len)]
        p_hash[0] = ord(pattern[0]) - ord('a') + 1

        for i in range(1, s_len):
            pow[i] = pow[i-1] * base

        for i in range(1, s_len):
            hash[i] = hash[i-1] * base + ord(s[i])-ord('a')+1

        for i in range(1, len(pattern)):
            p_hash[i] = p_hash[i-1] * base + ord(pattern[i])-ord('a')+1

        def string_hash(hash_table, l, r):
            ans = hash_table[r]
            if l > 0:
                ans -= hash_table[l-1] * pow[r+1-l]
            return ans

        patter_set = set()
        patter_set.add(string_hash(p_hash, 0, p_len-1))
        print(string_hash(hash, 1, 6))
        print(hash, p_hash)
        for i in range(p_len):
            for j in range(26):
                if chr(ord('a')+j) != pattern[i]:
                    if i == 3 and j == 4:
                        print(string_hash(p_hash, 0, 5))
                    if i-1 >= 0:
                        new_hash = string_hash(p_hash, 0, i-1) * pow[p_len-i] + (j+1)*pow[p_len-i-1] + string_hash(p_hash, i+1, p_len-1)
                    else:
                        new_hash = (j+1)*pow[p_len-i-1] + string_hash(p_hash, i+1, p_len-1)


                    patter_set.add(new_hash)
                    # new_pattern = pattern[:i]+chr(ord('a')+j)+pattern[i+1:]
                    # patter_set.add(get_hash(new_pattern))

        n = len(pattern)
        for i in range(len(s)):
            if i+n>len(s):
                break

            if string_hash(hash, i, i+n-1) in patter_set:
                return i
        return -1
